import React from "react";
import "./Cardcss.css";
// import medicineimage from 'Categories/Medicine/MedicineImage.png'
const Card = ({
  scrapFrom,
  medicineIMG,
  medicineName,
  medicineURL,
  medicineQnty,
  medicineMRP,
  medicineNewPrice,
  medicineSavedPrice
}) => {
  // const medicineName={name};
  // const medicineURL={url};
  // console.log(medicineName,medicineURL);
  const img = document.getElementById("image")
img.addEventListener("error", function(event) {
  event.target.src = "https://default-image-link-goes-here"
  event.onerror = null
})
  return (
    <div className="card">

      <div className="card-content">
        <div>Medicines from {scrapFrom}</div>
        <h2 className="card-title">{medicineName}</h2>
        <img src={medicineIMG} onerror="this.src='https://saicure.in/wp-content/uploads/2023/02/default-pharmacy-product-thumbnail.webp'" alt="MedicineImage"/>
        <p className="card-description">
          <a href={medicineURL} target="_blank" rel="noopener noreferrer">
            {medicineName}
          </a>
        </p>
        <div> Quantity : {medicineQnty}</div>
        <div> MRP : {medicineMRP}</div>
        <div> DiscountPrice : {medicineNewPrice}</div>
        <div> You Save  : {medicineSavedPrice}</div>
        <a href={medicineURL} target="_blank" rel="noopener noreferrer">
          <button className="card-button">More in Detail</button>
        </a>
      </div>
    </div>
  );
};

export default Card;
